// import HomePage from "./HomePage";
// import About from './About';
const HomePage = lazy(() => import('./HomePage'));
import './index.css';

function App() {
  return (
    <div className="App">
      <Suspense fallback={<div>Wait...</div>}>
        <HomePage />
      </Suspense>
    </div>
  );
}

export default App;
